import "./App.css";
import Navbar from "./navbar.js";
import jump from "./Assets/jump.jpg"; // jumping image

function About() {
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <body>
        {/* background image */}
        <div id="homepageBackground">
          <img
            id="abouthomepageImg"
            src={jump}
            alt="Person jumping for joy over a couch and pillows"
          ></img>
        </div>
        <div id="homepageText">
          {/* text */}
          <div className="subPopText">ADD A</div>
          <div id="popText">POP</div>
          <div className="subPopText">OF COLOR</div>
          <p>With our new Cozy Denim.</p>
          {/* shop now button */}
          <button className="hollowButton">SHOP NOW</button>
        </div>
      </body>
    </div>
  );
}

export default About;
